import React from 'react';
import Breakfast from '../components/Meals/Breakfast'
// import $ from "../nutritionLabel"
import {Card, CardHeader, CardActions, CardContent, Button} from "@material-ui/core"
const Authorization = () => {


  return (
    <header className="App-page">
       Welcome Back to FlatTrackerPal
       {/* {$('#test1').nutritionLabel()} */}
         <div className = "container"style={{display:'flex', alignItems: 'flex-start'}}>
          <Card className = "left" >
            <CardHeader
              title="Calendar"
              actAsExpander={true}
              showExpandableButton={true}
            />
              <CardContent>This is Calendar space
              </CardContent>
          </Card>

          <Card className="right" >
            <CardHeader
              title="Card 2"
              actAsExpander={true}
              showExpandableButton={true}
            />
              <Breakfast />
          </Card>
        </div>
    </header>

  )
}



export default Authorization;
